// Reset state is 0. Output is high in state 0. If in is low, state changes.
module simple_fsm(input clk, input reset, input in, output out);
reg present_state, next_state;

code.output:
module simple_fsm(input clk, input reset, input in, output reg out);
reg [1:0] present_state, next_state;

parameter STATE_0 = 2'b00;
parameter STATE_1 = 2'b01;

always @(posedge clk or posedge reset) begin
    if (reset)
        present_state <= STATE_0;
    else
        present_state <= next_state;
end

always @(*) begin
    case (present_state)
        STATE_0:
            if (!in)
                next_state = STATE_1;
            else
                next_state = STATE_0;
        STATE_1:
            if (!in)
                next_state = STATE_0;
            else
                next_state = STATE_1;
        default:
            next_state = STATE_0; // Default to state 0
    endcase
end

assign out = (present_state == STATE_0);

endmodule

